    public class HttpMessageHandlerMock : HttpMessageHandler
    {
        private readonly HttpStatusCode code;
        private readonly HttpResponseMessage _response;
        public HttpMessageHandlerMock(HttpStatusCode code) {
            this.code = code;
        }
        public HttpMessageHandlerMock(HttpResponseMessage response)
        {
            _response= response;
        }
        protected override Task<HttpResponseMessage> SendAsync(HttpRequestMessage request, CancellationToken cancellationToken)
        {
            if(_response != null)
            {
                return Task.FromResult(_response);
            }
            return Task.FromResult(new HttpResponseMessage()
            {
                StatusCode = code
            }); 
        }
    }
    public class CallBusinessTests
    {
        [Fact]
        public async Task ReturnsNull_When_Error()
        {
            Field field1 = new Field();
            field1.FieldId = Guid.NewGuid();
            field1.Name = "field 1";
            field1.Alt = 4150;

            Sensor sensor1 = new Sensor();
            sensor1.SerialNumber = "ADR12823129";
            sensor1.LastCommunication = DateTime.Now.AddDays(-2);
            sensor1.BatteryStatus = 1;
            sensor1.OptimalGDD = 85;
            sensor1.CuttingDateTimeCalculated = DateTime.Now.AddDays(17);
            sensor1.LastForecastDate = DateTime.Now.AddDays(17);
            sensor1.Lat = -16.516667;
            sensor1.Long = -68.166667;
            sensor1.Field = field1;


            var http = new HttpClient(new HttpMessageHandlerMock(HttpStatusCode.BadRequest));
            var service = new WeatherForecastApi(http);
            var result =await service.GetLocationForecast(sensor1);
            Assert.Null(result);
        }
